import React, { Component } from 'react'
import * as V from 'victory';
import { VictoryBar, VictoryChart, VictoryTheme } from 'victory';

const data = [
    {quarter: 10, earnings: 4.89},
    {quarter: 18, earnings: 8.94},
    {quarter: 25, earnings: 18.27},
    {quarter: 35, earnings: 18.10}
  ];

export class ChartOne extends Component {
    render() {
        return (
            <div>
                <VictoryChart theme={VictoryTheme.material} domainPadding={10} viewBox={"0 0 width, height" }>
                    <VictoryBar
                        style={{ data: { fill: "#c43a31" } }}
                        data={data}
                        x="quarter"
                        y="earnings"
                    />
                </VictoryChart>
            </div>
        )
    }
}

export default ChartOne
